import React from "react"
import { MDBInput, MDBCard, MDBCardBody } from "mdb-react-ui-kit"
export default function Card(props) {
  return (
    <MDBCard>
      <MDBCardBody>
        <MDBInput label="Tiktok id" id="formControlLg" type="text" size="lg" />
        <span>Please enter streaming Tiktok ID</span>
      </MDBCardBody>
    </MDBCard>
  )
}
